const jukeBox = {
  play: (name) => {
    const sound = sounds[name];
    if (sound) {
      console.log('EmojiSound: playing ', name, ' sound!');
      MakeBrowserDoSoundStuffGood("data:audio/mp3;base64," + sound);
    } else {
      console.log('EmojiSound: would play sound for ', name, ' but none available');
    }
  }
};

// Adapted from stackoverflow
// https://stackoverflow.com/questions/17762763/play-wav-sound-file-encoded-in-base64-with-javascript
var MakeBrowserDoSoundStuffGood = (function () {
  var documentFragment = document.createDocumentFragment();
  return function MakeBrowserDoSoundStuffGood(src) {
    var sound = new Audio(src);
    documentFragment.appendChild(sound); // keep in fragment until finished playing
    sound.addEventListener('ended', function () {
      documentFragment.removeChild(sound);
    });
    sound.play().catch(console.error);
    return sound;
  }
}());

export default jukeBox;

